import "./App.css";
import down from "./down.jpeg";

function App() {
  return (
    <div>
      <img className="down" alt="Niño con down" src={down}></img>
      <img
        className="down"
        alt="Perrito"
        src="https://media.tenor.com/wt3RTvjtRC4AAAAi/dancing-dance.gif"
      ></img>
      <p>Tiene síndrome, no se rían</p>
    </div>
  );
}

export default App;
